DROP TABLE IF EXISTS players;
CREATE TABLE IF NOT EXISTS players(
  Player_ID INTEGER(4) NOT NULL PRIMARY KEY AUTO_INCREMENT
, Player_Name VARCHAR(21)
, POSITION VARCHAR(4)
, TEAM VARCHAR(20)
, DIVISION VARCHAR(9)
, JERSEY INTEGER(2)
, OVERALL_RATING INTEGER(2)
, SPEED INTEGER(2)
, ACCELERATION INTEGER(2)
, STRENGTH INTEGER(2)
, AGILITY INTEGER(2)
, AWARENESS INTEGER(2)
, CATCHING INTEGER(2)
, CARRYING INTEGER(2)
, THROW_POWER INTEGER(2)
, KICK_POWER VARCHAR(2)
, KICK_ACCURACY VARCHAR(2)
, RUN_BLOCK INTEGER(2)
, PASS_BLOCK INTEGER(2)
, TACKLE INTEGER(2)
, JUMPING INTEGER(2)
, RETURN_SKILL INTEGER(2)
, INJURY INTEGER(2)
, STAMINA INTEGER(2)
, TOUGHNESS INTEGER(2)
, TRUCKING INTEGER(2)
, ELUSIVENESS INTEGER(2)
, BC_VISION INTEGER(2)
, STIFF_ARM INTEGER(2)
, SPIN_MOVE INTEGER(2)
, JUKE_MOVE INTEGER(2)
, IMPACT_BLOCK INTEGER(2)
, POWER_MOVE INTEGER(2)
, FINESSEE_MOVE INTEGER(2)
, BLOCK_SHEDDING INTEGER(2)
, PURSUIT INTEGER(2)
, PLAY_REC INTEGER(2)
, MAN_COVERAGE INTEGER(2)
, ZONE_COVERAGE INTEGER(2)
, SPECTACULAR_CATCH INTEGER(2)
, CATCH_IN_TRAFFIC INTEGER(2)
, ROUTE_RUNNING INTEGER(2)
, HIT_POWER INTEGER(2)
, PRESS INTEGER(2)
, THROW_RELEASE INTEGER(2)
, THROW_ACCURACY_SHORT INTEGER(2)
, THROW_ACCURACY_MED INTEGER(2)
, THROW_ACCURACY_DEEP INTEGER(2)
, PLAY_ACTION INTEGER(2)
, THROW_ON_RUN INTEGER(2)
);
